'''Daga''' is a monkey trader found on [[Ape Atoll]] and owner of [[Daga's Scimitar Smithy]] [[scimitar shop]]. Players can only talk to him while they are holding a [[greegree]] and wearing the [[m'speak amulet]] (they may still trade without an m'speak amulet amulet if they use the right-click option) unless they have completed [[Monkey Madness II]]. 

Next to Daga is a thievable stall, which is the only scimitar shop that can be stolen from. A player can steal [[steel scimitar]]s from his stall if they have a [[Thieving]] level of 65.

The stall stock will respawn every 40 seconds and can give both Thieving [[experience]] and [[Magic]] experience by using [[High Level Alchemy]] on the loot since the [[High Alchemy]] value is similar (or greater) to the market value of a [[nature rune]]; however, the rate is rather slow and there is a high chance of being caught and being imprisoned, as well as possibly dying due to the attacks of the [[Monkey Archer|monkey rangers]] and a blow from an official, level-149 [[Padulah]]. Stealing from this stall carries a high risk, with relatively little reward, monetarily as well as with regards to experience gained.

==Treasure Trails==
